import React from 'react';
import './App.css';
import Relogio from './Relogio'
import LabelTitulo from './LabelTitulo'
import {Navbar, Nav} from 'react-bootstrap';

function App_Relogio(){
  return (
    <div>
		<Navbar bg="primary" variant="dark">
			<Navbar.Brand href="#home">Relógio Online</Navbar.Brand>
			<Nav className="mr-auto">
				<Nav.Link href="/">Relógio</Nav.Link>
				<Nav.Link href="/cronometro">Cronômetro</Nav.Link>
				<Nav.Link href="/temporizador">Temporizador</Nav.Link>
			</Nav>
		</Navbar>
		<div class="container">
			<div class="justify-content-center d-flex mt-4">
				<LabelTitulo class="display-4 titulo" name="Horário Local"/>
			</div>
			<div class="justify-content-center d-flex">	
				<Relogio/>
			</div>
		</div>
    </div>
  );
}

export default App_Relogio;
